        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
            background: url("file:///C:/Users/tiger/Pictures/download%20(1).png") no-repeat center center fixed;
            background-size: cover;
        }

        header {
            background-color: #333;
            color: #fff;
            text-align: center;
            padding: 1em;
            font-family: 'Pacifico', cursive;
        }

        section {
            max-width: 800px;
            margin: 20px auto;
            padding: 20px;
            background-color: rgba(255, 255, 255, 0.8); /* Semi-transparent white background */
            border-radius: 8px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
            position: relative;
        }

        /* Style for the first image on the left */
        img.first-image {
            max-width: 100%;
            height: auto;
            border-radius: 8px;
            margin-left: 10%; /* Adjusted margin-left value */
            margin-right: 0;
        }

        p {
            line-height: 1.6;
        }

        /* Golden side borders with vines */
        body::before,
        body::after {
            content: '';
            position: fixed;
            top: 0;
            bottom: 0;
            width: 20px;
            background-color: #ffd700; /* golden color */
            z-index: -1;
        }

        body::before {
            left: 0;
        }

        body::after {
            right: 0;
        }

        .vine {
            content: '';
            position: absolute;
            width: 4px;
            height: 100%;
            background-color: #8b4513; /* saddle brown */
            top: 0;
            left: 50%;
            transform: translateX(-50%);
        }

        .thorn {
            content: '';
            position: absolute;
            width: 10px;
            height: 10px;
            background-color: #8b4513; /* saddle brown */
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%) rotate(45deg);
        }

        /* Style for the smaller image on the top right */
        .small-image {
            position: absolute;
            top: 20px;
            right: 950px; /* Adjusted right value */
            max-width: 200px;
            border-radius: 8px;
        }
